INSERT INTO `berita` (`id`, `judul`, `content`, `cover`, `url`, `viewer`, `read_time`, `publish_at`, `user_id`, `is_aktif`, `created_at`, `updated_at`, `kategori_id`) VALUES
	(4, 'JLS Sampang Memakan Korban, Pemuda Tabrak Tiang Listrik Meninggal di TKP', '<p style="margin-bottom: 15px; color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif;">Tabrak tiang listrik di Jalan Lingkar Selatan (JLS) Kabupaten&nbsp;<a href="https://beritajatim.com/politik-pemerintahan/bkpsdm-dan-dprd-sampang-ingatkan-netralitas-asn/" style="color: rgb(32, 64, 154); text-decoration: none;">Sampang</a>, seorang pemuda yang masih mengenakan seragam sekolah meninggal di lokasi kejadian, Rabu (27/9/2023).<div class="code-block code-block-1" style="color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif; margin: 8px 0px; clear: both;"></div><p style="margin-bottom: 15px; color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif;">&acirc;&#128;&#156;Korban laka tunggal ini mengalami luka parah pada bagian kepala dan meninggal di TKP,&acirc;&#128;&#157; terang Kanit Laka Satlantas Polres Sampang, Ipda Dody, Kamis (28/9/2023).</p><p style="margin-bottom: 15px; color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif;">Ia menceritakan, sebelum terjadi laka tunggal tersebut, korban yang mengendarai motor matik Honda W 6199 CH melaju kencang dari arah barat ke timur.</p><p style="margin-bottom: 15px; color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif;">Sesampainya di lokasi kejadian dan jarak terlalu dekat, maka korban tidak bisa mengendalikan kendaraanya lalu oleng ke kiri hingga menabrak tiang listrik.</p><p style="margin-bottom: 15px; color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif;">&acirc;&#128;&#156;Warga yang mengetahui kejadian laka tunggal itu, melaporkan ke petugas, dan polisi yang tiba dilokasi langsung melakukan olah TKP,&acirc;&#128;&#157; imbuhnya.</p><p style="margin-bottom: 15px; color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif;">Sekedar diketahui, Jalan Lingkar Selatan atau yang biasa disebut dengan istilah JLS, adalah jalan raya baru yang ada di Kabupaten Sampang, jalan itu dibagun dan diresmikan 2023 kemarin.</p><p style="margin-bottom: 15px; color: rgb(68, 68, 68); font-family: Helvetica, Arial, sans-serif;">JLS dibangun dengan anggaran ratusan milyar, sepanjang 7,4 Km dengan lebar 12 meter.</p></p>\n', 'sDpGrXLa20230929011225.webp', 'jls-sampang-memakan-korban--pemuda-tabrak-tiang-listrik-meninggal-di-tkp', NULL, 5, NULL, 2, 0, '2023-09-29 01:12:25', '2023-10-14 16:26:48', 6),
	(6, 'Jaga Harga Beras Terjangkau, Pemkab Lumajang akan Salurkan Beras Program SPHP secara Masif ke Seluruh Wilayah', '<p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">Pemerintah bersama Badan Urusan Logistik (Bulog), gencarkan pendistribusian beras melalui program Stabilisasi Pasokan dan Harga Pangan (SPHP), Program itu, menjadi salah satu upaya pemerintah menjaga stabilisasi harga sekaligus pengendalian inflasi di Lumajang.<p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">"Bulog sudah menyampaikan tadi, akan membantu 40 Ton, yang itu mulai hari Senin," kata Pj. Bupati Lumajang, Indah Wahyuni (Yuyun) dalam keterangannya usai mengikuti Video Conference Pengendalian Inflasi, bertempat di Ruang CCRoom Diskominfo Lumajang, Rabu (27/9/2023).</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">Yuyun juga mengatakan, bahwa SPHP merupakan bentuk lain dari operasi pasar yang ditujukan membantu masyarakat mendapatkan harga beras yang lebih terjangkau, atau sesuai Harga Eceran Tertinggi (HET).</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">"Yang tidak kalah penting ini publikasinya, sehingga apa yang kita lakukan bisa diketahui masyarakat, kemudian dimana-mana tempat yang bisa memperoleh harga beras sesuai HET," ujar dia.<br style="margin: 0px; padding: 0px;"><br style="margin: 0px; padding: 0px;">Berdasarkan data yang berhasil dihimpun oleh Dinas Ketahanan Pangan dan Pertanian Kabupaten Lumajang, disebutkan bahwa beras SPHP yang sudah disalurkan sampai 13 September 2023, tercatat sebanyak 653,994 Ton.</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">Sementara, untuk mengantisipasi adanya penimbunan stok beras, Indah Wahyuni meminta, agar stake holder terkait dapat memantau atau mengontrol beras SPHP yang akan digelontarkan.</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">"Jangan sampai banyak beras yang keluar akan tetapi malah ada yang ditimbun, ini yang akan menjadi masalah," terang dia.</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">Ia menambahkan, bahwa pemerintah daerah juga akan menggelar pasar murah pada bulan Oktober 2023 mendatang, tepatnya dalam peringatan Hari Pangan Sedunia.</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">"Dinas ketahanan pangan, tadi sudah menyampaikan akan melakukan di hari Pangan Sedunia, dua kali di bulan Oktober," imbuhnya. (Kominfo-lmj/Ard)</p><p></p></p>\n', 'AZkGmsOk20230930130029.jpg', 'jaga-harga-beras-terjangkau--pemkab-lumajang-akan-salurkan-beras-program-sphp-secara-masif-ke-seluruh-wilayah', NULL, 7, NULL, 2, 3, '2023-09-30 12:52:45', '2023-10-13 03:10:40', 19),
	(7, 'Cerita Mbah So, Penjaga Tari Topeng Kaliwungu Lumajang yang Kini Jadi Pengayuh Becak', '<p><span style="color: rgb(42, 42, 42); font-family: Roboto, sans-serif;">Tak ada yang menyangka, Sutomo atau Mbah So (60), sang pengayuh becak adalah salah satu sosok di balik lestarinya Tari Topeng Kaliwungu. Tarian itu adalah kesenian tradisional asli Kabupaten Lumajang, Jawa Tengah yang hingga kini masih dipentaskan. Selain beraktivitas sebagai tukang becak di Kecamatan Pasirian, Mbah So bisa dibilang merupakan sosok di balik&nbsp;melejitnya eksistensi Tari Topeng Kaliwungu sampai ditetapkan sebagai warisan budaya tak benda (WBTB) milik Kabupaten Lumajang oleh Kementerian Pendididikan pada 2021.</span><br style="color: rgb(42, 42, 42); font-family: Roboto, sans-serif;"><p><span style=\'color: rgb(42, 42, 42); font-family: "Arial Black";\'><b>Mengenal Mbah So</b></span></p><p><span style="color: rgb(42, 42, 42); font-family: Roboto, sans-serif;">Mbah So memang bukan pencipta Tari Topeng Kaliwungu. Penggagasnya adalah Mbah Sanemo, pria asli Madura yang hijrah ke Lumajang, tepatnya di Desa Kaliwungu, Kecamatan Tempeh. Mbah Sanemo mengakulturasikan kebudayaan Madura dengan Matraman sampai lahir Tari Topeng Kaliwungu. Mbah Sanemo memiliki puluhan murid untuk diajari menari Topeng Kaliwungu. Satu di antaranya Sutomo. Namun, dari sekian banyak murid Mbah Sanemo, hanya Sutomo yang masih hidup. Sedangkan, teman-teman seperjuangannya telah meninggal dunia terlebih dahulu. Kini, usia Mbah So telah menginjak 60 tahun. Kala belajar dengan Mbah Sanemo, Mbah So berusia 7 tahun dan menjadi murid termuda ketika itu. Mbah So kecil mulanya hanya ikut membantu Mbah Sanemo menarik layar untuk pertunjukan ludruk. Kesungguhan Sutomo itu rupanya diperhatikan Mbah Sanemo dari hari ke hari. "Mulai nari habis sunat itu, lupa angkanya (tahunnya). Awalnya ya narik layar itu ikut bantu Mbah Nemo," kata Sutomo di rumahnya, Rabu (20/9/2023).</span></p><p><span style=\'color: rgb(42, 42, 42); font-family: "Arial Black"; background-color: var(--ct-card-bg); font-size: var(--ct-body-font-size); font-weight: var(--ct-body-font-weight); text-align: var(--ct-body-text-align);\'>Masa muda dan Tarian Topeng Kaliwungu</span></p><p><span style="color: rgb(42, 42, 42); font-family: Roboto, sans-serif;">Suatu Mbah Sanemo memanggil Sutomo untuk menari. Namun, pelajaran pertama yang diterima Sutomo kala itu adalah memainkan gendang. Sebab, wajib hukumnya bagi seorang penari untuk mengetahui irama musik yang akan mengiringinya agar setiap gerak tarian bisa selaras. Darah seni rupanya telah mengalir pada diri Mbah So sejak kecil. Tidak butuh waktu lama, kurang dari seminggu, Mbah So sudah mahir memainkan gendang.&nbsp;</span><span style="color: rgb(42, 42, 42); font-family: Roboto, sans-serif; background-color: var(--ct-card-bg); font-size: var(--ct-body-font-size); font-weight: var(--ct-body-font-weight); text-align: var(--ct-body-text-align);">Setelah itu baru Mbah So belajar menari Topeng Kaliwungu. Mulai dari cara berjalan, menghentakkan kaki, mengepakkan tangan dan menggelengkan kepala. "Awal (belajar) gendang, pas bisa langsung nari, ya mulai dari jalannya sampai bisa sekarang ini," lanjutnya. Masa kanak-kanak Mbah So dihabiskan untuk mendalami Tari Topeng Kaliwungu. Saat remaja, gerakan menarinya sudah semakin mahir, tak heran jika Mbah So kerap diajak Mbah Sanemo untuk tampil dalam berbagai acara. Kala itu, memang tidak banyak festival maupun gelaran budaya yang digelar di alun-alun maupun panggung-panggung megah.&nbsp;</span><span style="color: rgb(42, 42, 42); font-family: Roboto, sans-serif; background-color: var(--ct-card-bg); font-size: var(--ct-body-font-size); font-weight: var(--ct-body-font-weight); text-align: var(--ct-body-text-align);">Tari Topeng Kaliwungu biasanya ditampilkan dalam acara-acara adat maupun acara pernikahan hingga khitanan warga. Dulu, untuk sekali tampil dengan durasi pertunjukan 1 jam, para penari ini mendapatkan bayaran Rp 50.000. Kini, bayaran yang diterima sudah naik menjadi Rp 200.000 untuk sekali pertunjukan. Namun, yang membedakan adalah intensitas pertunjukannya kini semakin jarang. Hanya bulan-bulan tertentu, kelompok tari Sutomo ini mendapatkan undangan untuk tampil. "Pokoknya ke mana-mana ikut Mbah Nemo, bayarannya ya sedikit, tapi saya enggak pernah mikir bayaran, yang penting saya nari gitu saja," terangnya.</span></p><br></p>\n', 'YMHojZAl20230930130655.jpg', 'cerita-mbah-so--penjaga-tari-topeng-kaliwungu-lumajang-yang-kini-jadi-pengayuh-becak', NULL, 15, NULL, 2, 2, '2023-09-30 13:06:55', '2023-10-04 12:36:55', 19),
	(8, 'Foto Terkini Kondisi Kebakaran di Gunung Bromo', '<p><span style="font-family: Helvetica-FF, Arial, Tahoma, sans-serif; font-size: 16px;">Dilaporkan pada Senin (11/9/2023) atau masuk hari kelima, kebakaran di Gunung Bromo gegara flare pengunjung prewedding belum padam. Begini kondisinya.</span><br><p><img src="data:image/jpeg;base64," data-filename="belum-padam-gunung-bromo-hangus-dilalap-api-3_169.jpeg" style="width: 700px;"></p><p><img src="data:image/jpeg;base64," data-filename="belum-padam-gunung-bromo-hangus-dilalap-api_169.jpeg" style="width: 700px;"></p><p></p><p><span style="font-family: Helvetica-FF, Arial, Tahoma, sans-serif; font-size: 16px;">Ini penampakan terkini kebakaran di Gunung Bromo, Senin (11/9/2023). Seluruh kawasan wisata di Gunung Bromo masih ditutup total hingga hari ini. Upaya water bombing menggunakan helikopter terus dilakukan untuk memadamkan kebakaran di Bromo. Fokus pemadaman berada di wilayah Blok Watangan dan sekitarnya. Dok. BPBD Kabupaten Malang</span><br style="font-family: Helvetica-FF, Arial, Tahoma, sans-serif; font-size: 16px;"><br style="font-family: Helvetica-FF, Arial, Tahoma, sans-serif; font-size: 16px;"><span style="font-family: Helvetica-FF, Arial, Tahoma, sans-serif; font-size: 16px;">Sementara itu, pada, Sabtu (9/9) kondisi kebakaran terlihat menyisakan beberapalokasi yang hangus.</span><br style="font-family: Helvetica-FF, Arial, Tahoma, sans-serif; font-size: 16px;"><br></p></p>\n', '6Tnc5UP820230930130930.jpeg', 'foto-terkini-kondisi-kebakaran-di-gunung-bromo', NULL, 5, NULL, 2, 2, '2023-09-30 13:09:30', '2023-10-04 12:38:19', 6),
	(9, 'Miliki Potensi Besar, Stakeholder di Lumajang Diajak untuk Kembangkan Komoditas Tembakau dan Kopi', '<p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">Kabupaten Lumajang, Jawa Timur memiliki potensi hasil produksi komoditas tembakau dan kopi yang sangat besar. Oleh karena itu, diharapkan semua pihak/stakeholder bersinergi untuk mengembangkan, serta meningkatkan produksi dan nilai tambahnya.<p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">&acirc;&#128;&#156;Potensi yang besar ini, memerlukan perhatian dan peran semua pihak terkait untuk mengembangkan, meningkatkan produksi dan nilai tambah, serta pemasaran produk Tembakau maupun Kopi di Kabupaten Lumajang," ungkap Kepala Dinas Pertanian dan Ketahanan Pangan Kabupaten Lumajang, Hairil Diani saat dimintai keterangan di sela kegiatannya, Selasa (8/8/2023).</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">Hairil juga mengungkapkan, bahwa besarnya potensi tembakau dan kopi di Lumajang, berdasarkan dari luas lahan tanaman tembakau di Kabupaten Lumajang mencapai 984,79 hektare yang tersebar di 14 kecamatan, dengan hasil produksi mencapai 2.055,52 ton (Tahun 2022).</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">Kemudian, untuk luasan lahan tanaman kopi mencapai 4.451 Hektare yang tersebar di 12 kecamatan, dengan produksi 240,67 ton (Januari - Juni 2023).</p><p style="margin-right: 0px; margin-left: 0px; padding: 0px; line-height: unset; font-size: 15px; color: rgb(102, 102, 102); font-family: Arial, sans-serif; text-align: justify;">&acirc;&#128;&#156;Potensi Tembakau dan Kopi di Lumajang ini sangatlah besar, karena lahannya tersebar di sejumlah kecamatan, dan hasil produksi setiap tahunnya cukup besar, yakni Tahun 2022 berkisar 2.055,52 ton untuk Tembakau, dan Periode Januari - Juni 2023 berkisar 240,67 ton untuk Kopi. (Kominfo-lmj/Ad)</p></p>\n', 'iIooY8c320230930131127.jpg', 'miliki-potensi-besar--stakeholder-di-lumajang-diajak-untuk-kembangkan-komoditas-tembakau-dan-kopi', NULL, 5, NULL, 2, 2, '2023-09-30 13:11:27', '2023-10-20 05:54:39', 21);
