	(8, 1, 'Walden (Walden; or, Life in the Woods)', 'Sebuah buku berdasarkan kisah hidupnya selama 2 tahun di Walden Pond di tanah Ralph Waldo Emerson. Buku ini mengekspresikan terhadap industrialisasi dan peperangan dengan pandangan generasi muda yang menentang demi kehidupan sederhana.', '1ltBKIt820230930042550.jpg', 'walden-walden-or-life-in-the-woods', NULL, NULL, NULL, NULL, 5, '1854-01-01', 1, 6, 0, '2023-09-30 04:25:50', '2023-10-22 13:45:56', 2, 8, 0, 'SXJiHzpV20230930042550.pdf'),
	(9, 1, 'Sedang Tuhan pun Cemburu', 'Esai-esai yang ditulis, merefleksikan betapa panjang pertanyaannya atas hidup. Emha tak hanya melihat pola interaksi manusia dengan Tuhan semakin mengabur, tetapi juga semakin tersingkirnya manusia dari strata sosial yang mereka bentuk sendiri.', 'cldTcqq120230930065637.jpg', 'sedang-tuhan-pun-cemburu', 'ISBN 978-602-291-079-4', NULL, NULL, NULL, 8, '2015-01-01', 1, 5, 0, '2023-09-30 06:56:37', '2023-10-16 08:22:12', 2, 16, 0, 'xk8fA19y20230930065637.pdf'),
	(10, 1, 'The Time Machine', 'The Time Machine ditulis oleh H. G. Wells. Karya ini dianggap sebagai pengenalan konsep perjalanan waktu melalui penggunaan alat untuk perjalanan secara sengaja dan selektif ke masa depan atau masa lalu.', 'zZkXVlK820230930070204.jpg', 'the-time-machine', NULL, NULL, NULL, NULL, 9, '1895-01-01', 1, 12, 0, '2023-09-30 07:02:04', '2023-10-19 15:18:00', 2, 17, 0, 'O1PgOEOn20230930070204.pdf'),
	(11, 1, 'The Invisible Man', 'Griffin, menemukan cara untuk mengubah indeks bias suatu benda menjadi indeks bias udara sehingga tidak menyerap atau memantulkan cahaya. Dia melakukan pada dirinya sendiri menjadi tidak terlihat, tapi gagal kembali semula.', 'K1ME0imT20230930071212.jpg', 'the-invisible-man', NULL, NULL, NULL, NULL, 10, '2023-01-01', 1, 7, 0, '2023-09-30 07:12:12', '2023-10-19 05:50:18', 2, 18, 0, 'ZZfJGrlY20230930071212.pdf'),
	(12, 2, 'Pembangunan Sistem Informasi Penjualan Obat pada Depo di RSUD Soreang Kabupaten Bandung', 'Rumah sakit umum daerah (RSUD) Soreang merupakan rumah sakit yang berada di kabupaten Bandung. Bagian farmasi adalah bagian yang khusus mengelola kebutuhan obatobatan pada RSUD Soreang.', 'qUDhrWai20230930073447.jpg', 'pembangunan-sistem-informasi-penjualan-obat-pada-depo-di-rsud-soreang-kabupaten-bandung', 'ISBN: 978-602-1180-50-1', NULL, NULL, NULL, NULL, '2023-03-20', 1, 5, 0, '2023-09-30 07:34:47', '2023-10-18 14:16:53', 2, 9, 0, 'HAAfsFIt20230930120941.pdf'),
	(13, 2, 'Aplikasi Sistem Reminder Masa Kadaluarsa Berbasis GIS dengan Platform Android', 'Aplikasi sistem reminder kadaluarsa ini mampu memberikan user peringatan sesuai input expired reminder seperti makanan, minuman, obat-obatan, juga aktivitas yang ingin diingat dan dokumen reminder, kontrak reminder, event reminder seperti cathering.', '1nKpMV3r20230930073936.jpg', 'aplikasi-sistem-reminder-masa-kadaluarsa-berbasis-gis-dengan-platform-android', NULL, NULL, 'ISSN: 2252-3006', NULL, 11, '2015-04-01', 1, 7, 0, '2023-09-30 07:39:36', '2023-10-17 11:40:00', 2, 9, 0, 'gVFdqLr620230930073936.pdf'),
	(14, 2, 'Bioethanol Limbah Kulit Jeruk Manis (Citrus Sinensis L. Osbeck) Sebagai Peningkatan Nilai Oktan', 'Bioetanol merupakan biofuel yang dapat mengantikan bahan bakar bensin. Selain itu bioetanol dihasilkan oleh proses fermentasi glukosa kemudian dilanjutkan dengan proses destilasi.', 'IMufsoLk20230930074556.jpg', 'bioethanol-limbah-kulit-jeruk-manis--citrus-sinensis-l--osbeck--sebagai-peningkatan-nilai-oktan', NULL, 'ISSN 1410-9867', 'ISSN 2656-3290', NULL, 12, '2023-09-01', 1, 12, 0, '2023-09-30 07:45:56', '2023-10-19 05:34:03', 2, 13, 0, 'BLtIPdBB20230930074556.pdf'),
