INSERT INTO `content_menu` (`id`, `judul`, `content`, `cover`, `url`, `viewer`, `read_time`, `publish_at`, `user_id`, `is_aktif`, `created_at`, `updated_at`, `submenu_id`) VALUES
	(10, NULL, '<h1 style=\'font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; color: rgb(37, 37, 37); font-size: 16px; text-align: justify;\'><span style="font-size: 10pt; font-family: Impact;">1.&nbsp;</span><span style="background-color: var(--ct-card-bg); font-weight: var(--ct-body-font-weight); font-family: Impact;">Blood Jek</span><span style="background-color: var(--ct-card-bg); font-weight: var(--ct-body-font-weight); font-family: Impact;">&nbsp;</span><p style=\'color: rgb(37, 37, 37); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 16px; text-align: justify;\'><span style="font-size: 10pt;">Sepeda motor putih berlambang Palang Merah Indonesia (PMI) dengan boks khusus berseliweran di Kabupaten Lumajang. Mereka adalah Blood Jek Si Pengawal Darah, yang berperan sebagai mengantar darah bagi masyarakat yang membutuhkan. Kalau dulu dibutuhkan waktu 2 sampai 3 jam, sekarang cukup 15 menit darah akan diantar oleh petugas UTD langsung ke ruang tempat pasien dirawat.</span></p><p style=\'color: rgb(37, 37, 37); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 16px; text-align: justify;\'><span style="font-size: 10pt;">Inovasi dari Unit Transfusi Darah (UTD) PMI Kabupaten Lumajang ini membuat pemesanan darah semudah memesan ojek online. &Atilde;&cent;&acirc;&#130;&not;&Aring;&#147;Pasien hanya perlu 15 menit untuk mendapatkan darah yang dibutuhkan,&Atilde;&cent;&acirc;&#130;&not;&Acirc;&#157; ujar Bupati Lumajang, As&Atilde;&cent;&acirc;&#130;&not;&acirc;&#132;&cent;at Malik saat presentasi Top 99 Inovasi Pelayanan Publik 2018 di Kementerian Pendayagunaan Aparatur Negara dan Reformasi Birokrasi (PANRB).</span></p><p style=\'color: rgb(37, 37, 37); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 16px; text-align: justify;\'><span style="font-size: 10pt;">Dikatakan, inovasi yang masuk Top 99 Inovasi pelayanan Publik 2018 ini dirancang khusus untuk menjamin kualitas dan kemudahan dalam pelayanan kebutuhan darah. Kalau dulu dibutuhkan waktu 2 sampai 3 jam, sekarang cukup 15 menit. Warga cukup melakukan permintaan darah dengan membawa formulir permintaan dan sampel darah serta menyelesaikan proses administrasi di UTD. Proses ini hanya membutuhkan waktu 10 menit. Darah akan diantar oleh petugas UTD langsung ke ruang tempat pasien dirawat. &Atilde;&cent;&acirc;&#130;&not;&Aring;&#147;Layanan ini dilakukan 24 jam tanpa biaya tambahan untuk seluruh rumah sakit di wilayah Lumajang,&Atilde;&cent;&acirc;&#130;&not;&Acirc;&#157; imbuh As&Atilde;&cent;&acirc;&#130;&not;&acirc;&#132;&cent;at.</span></p><p style=\'color: rgb(37, 37, 37); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 16px; text-align: justify;\'><span style="font-size: 10pt;">Sebelum adanya inovasi ini, tidak sedikit keluarga pasien yang membawa darah hanya menggunakan kantong plastik, sehingga suhunya tidak terjamin. Kini, di motor setiap pengantar darah, ada&nbsp;<em>cool box</em>&nbsp;khusus yang menjamin suhu dan kualitas darah pasien tetap dalam keadaan baik. Setiap sepeda motor dilengkapi dengan boks besar dengan kapasitas 45 liter di bagian belakang yang dapat diisi dua cool box kecil sebagai tempat penyimpanan darah. Masing-masing cool box dilengkapi dengan formulir kontrol dan termometer digital untuk mengontrol suhu penyimpanan darah sesuai dengan jenis produk darah yang dibawa.</span></p></h1>\n', NULL, 'inovasi-pemerintah-daerah', NULL, NULL, NULL, 1, NULL, '2023-10-04 22:51:01', '2023-10-19 05:55:39', 3),
	(12, NULL, '<p class="MsoNormal" style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Sesuai dengan&nbsp;</span><span style="font-weight: bolder;"><span lang="EN-US" style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Peraturan Daerah Kabupaten Lumajang Nomor 4 Tahun 2021 Tentang Perubahan Atas Peraturan Daerah Nomor 15 Tahun 2016 Tentang Pembentukan&nbsp;</span></span><span style="font-weight: bolder;"><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">d</span></span><span style="font-weight: bolder;"><span lang="EN-US" style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">an Susunan Perangkat Daerah</span></span><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">&nbsp;dan&nbsp;<span style="font-weight: bolder;">Peraturan Bupati Lumajang Nomor 108 Tahun 2021 Tentang Kedudukan, Susunan Organisasi, Uraian Tugas Dan Fungsi Serta Tata Kerja Badan Perencanaan Pembangunan Daerah</span>, Badan Perencanaan Pembangunan Daerah (atau disingkat dengan BAPPEDA) Kabupaten Lumajang mempunyai tugas membantu Bupati dalam melaksanakan fungsi penunjang urusan pemerintahan yang menjadi kewenangan daerah di bidang perencanaan dan bidang penelitian dan pengembangan.</span><p class="MsoNormal" style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">BAPPEDA Kabupaten Lumajang dalam melaksanakan tugas menyelenggarakan fungsi :</span></p><ul><li style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify; text-indent: -18pt;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">a.<span style=\'font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";\'>&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Penyusunan kebijakan teknis di bidang perencanaan, penelitian, dan pengembangan;</span></li><li style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify; text-indent: -18pt;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">b.<span style=\'font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";\'>&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Pelaksanaan tugas dukungan teknis di bidang perencanaan, penelitian, dan pengembangan;</span></li><li style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI