	(13, NULL, '<p class="MsoNormal" style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Sesuai dengan&nbsp;</span><span style="font-weight: bolder;"><span lang="EN-US" style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Peraturan Daerah Kabupaten Lumajang Nomor 4 Tahun 2021 Tentang Perubahan Atas Peraturan Daerah Nomor 15 Tahun 2016 Tentang Pembentukan&nbsp;</span></span><span style="font-weight: bolder;"><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">d</span></span><span style="font-weight: bolder;"><span lang="EN-US" style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">an Susunan Perangkat Daerah</span></span><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">&nbsp;dan&nbsp;<span style="font-weight: bolder;">Peraturan Bupati Lumajang Nomor 108 Tahun 2021 Tentang Kedudukan, Susunan Organisasi, Uraian Tugas Dan Fungsi Serta Tata Kerja Badan Perencanaan Pembangunan Daerah</span>, Badan Perencanaan Pembangunan Daerah (atau disingkat dengan BAPPEDA) Kabupaten Lumajang mempunyai tugas membantu Bupati dalam melaksanakan fungsi penunjang urusan pemerintahan yang menjadi kewenangan daerah di bidang perencanaan dan bidang penelitian dan pengembangan.</span><p class="MsoNormal" style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">BAPPEDA Kabupaten Lumajang dalam melaksanakan tugas menyelenggarakan fungsi :</span></p><ul