 Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify; text-indent: -18pt;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">c.<span style=\'font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";\'>&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Pemantauan, evaluasi dan pelaporan pelaksanaan tugas dukungan teknis di bidang perencanaan, penelitian, dan pengembangan;</span></li><li style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify; text-indent: -18pt;\'><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">d.<span style=\'font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";\'>&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size: 12pt; line-height: 17.12px; font-family: Arial, sans-serif;">Pembinaan teknis penyelenggaraan fungsi penunjang urusan pemerintahan daerah di bidang perencanaan, penelitian, dan pengembangan;</span></li><li style=\'color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 13.3333px; text-align: justify; text-indent: -18p